// DashboardTable.js
import React from 'react';
import Button from '@mui/material/Button';
import { useFiles } from '../components/FileContext'; // Adjust the import path as needed

const DashboardTable = () => {
    const { addFile } = useFiles();

    const handleSyllabusUpload = (event) => {
        const file = event.target.files[0];
        if (file) {
            // Here, you would process the CSV file
            // For now, just log it to the console
            console.log(file.name);
            // Placeholder for processing and updating the file list
        }
    };

    return (
        <div>
            <input
                accept=".csv"
                style={{ display: 'none' }}
                id="raised-button-file"
                multiple
                type="file"
                onChange={handleSyllabusUpload}
            />
            <label htmlFor="raised-button-file">
                <Button variant="contained" component="span">
                    Upload Syllabus
                </Button>
            </label>
            {/* Rest of your DashboardTable content */}
        </div>
    );
};

export default DashboardTable;
